import React, { Component } from "react";
import './clients.css';
import axios from "axios";

export class Dashboard extends Component {
  constructor() {
    super();
    this.state = {
      users: []
    };
  }

  componentDidMount() {
    axios.get("/api/users").then(response =>
      this.setState({
        users: response.data
      })
    );
  }

  render() {
    let { users } = this.state;
    console.log(users);
    let mappedUsers = users.map(user => {
      return (
        <div className='clients' key={user.id}>
          <h1>{user.first_name} {user.last_name}</h1>
          <h2> Phone number: {user.phone_number}</h2>
          <h2> Email: {user.email}</h2>
          <h2> Price Range: {user.price}</h2>
          <h2> Time Frame: {user.timeframe === null ? '?' : user.timeframe}</h2>
          <h2> Realtor: { user.realtor === true ? 'Yes' : 'No' }</h2>
          <h2>Last Contacted: {user.last_contacted == null ? 'No contact' : user.last_contacted}</h2>
          <hr/>


        </div>);
    });

    return (
      <div>
        <h1 style={{fontSize:'40px'}}>Clients</h1>
        <hr/>
        {mappedUsers}
      </div>
    );
  }
}

export default Dashboard;
